//
async function loopFireBullet() {
  fireCount++;
  if (fireCount % 5 === 0) {
    log('');
    await sleep(5000);
  }
  if (fireData.random) {
    let types = [];
    if (fireData.chp) types.push('');
    if (fireData.mrbd) types.push('');
    if (fireData.djt) types.push('');
    if (types.length <= 0) types = ['', '', ''];

    let bullet = await getBulletByType(types[randomNum(0, types.length - 1)]);
    fireBullet(bullet);
    stepTimer = setTimeout(() => {
      loopFireBullet();
    }, randomNum(fireData.speed * 1000, (fireData.speed + 1) * 1000));
  } else {
    if (fireData.bullets.length > 0) {
      fireBullet(fireData.bullets[randomNum(0, fireData.bullets.length - 1)]);
      stepTimer = setTimeout(() => {
        loopFireBullet();
      }, randomNum(fireData.speed * 1000, (fireData.speed + 1) * 1000));
    } else {
      showMessage('', 'error');
      isFiring = false;
      getElement('#btnStart').innerText = '';
      getElement('#btnStart').classList.remove('cked');
    }
  }
}

//
function getBulletByType(type) {
  let urls = {
    '': 'https://chp.shadiao.app/api.php',
    '': 'https://nmsl.shadiao.app/api.php?level=min',
    '': 'https://du.shadiao.app/api.php'
  };
  return new Promise(resolve => {
    GM_xmlhttpRequest({
      method: 'GET',
      url: urls[type],
      responseType: 'text',
      onload: function (response) {
        let ret = response.response;
        if (ret !== '') {
          resolve(ret);
        }
      }
    });
  });
}

